import './style.css';

const Footer = () => {
    return (
        <footer className="footer">
            <div className="footer_logo">BookStore</div>

            <div className="footer_content">
                <ul className="column-1">
                    <li>To customers</li>
                    <li>Order tracking</li>
                    <li>Shipping</li>
                    <li>Shipping</li>
                </ul>
            </div>
        </footer>
    )
}

export default Footer;
